import classes from "../css/style.css";
function Home() {
    return (
        <>
            <div className='homeContentWrapper'>
                <div className='overlayBox'>
                    <div className="container">
                        <div className='welcomeText'>WELCOME TO <br/>Online E-Commerce Application</div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Home;
